function AgentJohnProfile(props) {
  const card1template = {
    cardImg: house1,
  }
  return (
    <div className="agent_john_profile">
      <AgentProfiles agentImg={agent1} agentName="John Ryan" card1template={card1template} />
    </div>
  );
}

export default AgentJohnProfile;
